/*************配置************/
function declareConfig() {
	BarrierFreeConfig = new Object();
	//定义网页body里面最外层DIV ID
	BarrierFreeConfig.mainBox = "barrierfree_container";

	//无障碍操作说明链接地址
	var pathname = window.location.pathname;
	if (!Array.prototype.indexOf)
	{
	  Array.prototype.indexOf = function(elt /*, from*/)
	  {
	    var len = this.length >>> 0;
	    var from = Number(arguments[1]) || 0;
	    from = (from < 0)
	         ? Math.ceil(from)
	         : Math.floor(from);
	    if (from < 0)
	      from += len;
	    for (; from < len; from++)
	    {
	      if (from in this &&
	          this[from] === elt)
	        return from;
	    }
	    return -1;
	  };
	}
	if(pathname.indexOf("/view/")!=-1){
		path = pathname.substr(0,pathname.indexOf("/web")) + "/module/jslib/accessiblereading/wza_help.html";
//		if(pathname.indexOf("col")!=-1){
//			path = "../../../module/accessiblereading/wza_help.html";
//		}else if(pathname.indexOf("art")!=-1){
//			path = "../../../../../module/accessiblereading/wza_help.html";
//		}else{
//			path = "../module/accessiblereading/wza_help.html";
//		}
	}else{
		path = "/module/jslib/accessiblereading/wza_help.html";
//		if(pathname.indexOf("col")!=-1){
//			path = "../../module/accessiblereading/wza_help.html";
//		}else if(pathname.indexOf("art")!=-1){
//			path = "../../../../module/accessiblereading/wza_help.html";
//		}else{
//			path = "module/accessiblereading/wza_help.html";
//		}
	}
	BarrierFreeConfig.barrierfreeHelp = path;

	// 以下是网页区域标识，快捷键导航时使用
	// 无障碍操作说明ID
	BarrierFreeConfig.AccessHelp = 'accesshelp';
	BarrierFreeConfig.AccessHelpTitle = "已定位到无障碍帮助";

	//主导航区ID
	BarrierFreeConfig.MainNavigation = 'mainNav';
	BarrierFreeConfig.MainNavigationTitle = "已定位到网站导航";

	//服务引导区
	BarrierFreeConfig.HeaderGuide = 'headerGuideNav';
	BarrierFreeConfig.HeaderGuideTitle = "已跳转到网站服务引导区";

	//主要内容区ID
	BarrierFreeConfig.MainContent = 'main';
	BarrierFreeConfig.MainContentTitle = "已跳转到主要内容区";

	//网站地图区ID
	BarrierFreeConfig.SiteMap = 'copyright';
	BarrierFreeConfig.SiteMapTitle = "已跳转到网站地图区";

	//搜索区ID
	BarrierFreeConfig.SearchForm = 'search';
	BarrierFreeConfig.SearchFormTitle = "已跳转到搜索区域";

	//头部内容区ID
	BarrierFreeConfig.HeadContent = 'header';
	BarrierFreeConfig.HeadContentTitle = "已跳转到头部内容区域";

	//底部内容区ID
	BarrierFreeConfig.BottomContent = 'footer';
	BarrierFreeConfig.BottomContentTitle = "已跳转到底部内容区域";

	//网页左栏区ID
	BarrierFreeConfig.LeftContent = 'leftSidebar';
	BarrierFreeConfig.LeftContentTitle = "已跳转网页左栏区域";

	//网页中间区ID
	BarrierFreeConfig.MiddleContent = 'leftbox';
	BarrierFreeConfig.MiddleContentTitle = "已跳转到中间结构区域";

	//网页右栏区ID
	BarrierFreeConfig.RightContent = 'rightSidebar';
	BarrierFreeConfig.RightContentTitle = "已跳转到网页右栏区域";

	//栏目分组标记 H2 或 H3 或 H4
	BarrierFreeConfig.GroupTagNameH2 = 'H2';
	BarrierFreeConfig.GroupTagNameH3 = 'H3';
	BarrierFreeConfig.GroupTagNameH4 = 'H4';

	//图文模式工具样式
	BarrierFreeConfig.HtmlToolCssUrl = 'barrierfree.css';
	//文本模式工具样式
	//BarrierFreeConfig.TextToolCssUrl = serverUrl + 'barrierfree_tool_style.css';

	//文本模式页面样式
	if(pathname.indexOf("/view/")!=-1){
		path = pathname.substr(0,pathname.indexOf("/web")) + "/module/jslib/accessiblereading/css/barrierfree_style.css";
	}else{
		path = "/module/jslib/accessiblereading/css/barrierfree_style.css";
	}
	BarrierFreeConfig.TextModeCssUrl = path;
}


