var GroupTagNameH3 = 'H3';
var GroupTagNameH4 = 'H4';
//栏目分组计数器初始化为-1
var GroupCount = -1;
//顺（逆）向标记
var ForwardFlag = false;
var BackwardFlag = false;

//快捷键执行函数

function accessKeyboardListener(currkey, e) {
	var browser = browserFlag();
	//浏览器类型判断
	/*--------------------------------------------------------热点跳转开始--------------------------------------------------------*/
	if (String(navigator.platform).indexOf("Win") != -1) {
		//windows操作系统
		if ((e.altKey && !e.shiftKey && !e.ctrlKey) || (!e.altKey && !e.shiftKey && e.ctrlKey)) {
			if (currkey == NumOneKey) {
				//alt+1: 定位到无障碍操作说明连接锚点，
				document.getElementById(BarrierFreeConfig.AccessHelp).focus();
			} else if (currkey == NumTwoKey) {
				//alt+2: 定位到网站导航容器，
				createNodeDiv(BarrierFreeConfig.MainNavigation, BarrierFreeConfig.MainNavigationTitle);
			} else if (currkey == NumThreeKey) {
				//alt+3: 定位到网站服务引导区，
				createNodeDiv(BarrierFreeConfig.HeaderGuide, BarrierFreeConfig.HeaderGuideTitle);
			} else if (currkey == NumFourKey) {
				//alt+4: 定位到主要内容区，
				createNodeDiv(BarrierFreeConfig.MainContent, BarrierFreeConfig.MainContentTitle);
			} else if (currkey == NumFiveKey) {
				//alt+5: 定位到网站地图连接，
				createNodeDiv(BarrierFreeConfig.SiteMap, BarrierFreeConfig.SiteMapTitle);
				//document.getElementById(SiteMap).focus();
			} else if (currkey == NumSixKey) {
				//alt+6: 定位到页面主要搜索框，
				createNodeDiv(BarrierFreeConfig.SearchForm, BarrierFreeConfig.SearchFormTitle);
			}
		}
	} else if (String(navigator.platform).indexOf("Mac") != -1) {
		//Mac操作系统
		if (!e.altKey && !e.shiftKey && e.ctrlKey) {
			if (currkey == NumOneKey) {
				//alt+1: 定位到无障碍操作说明连接锚点，
				document.getElementById(BarrierFreeConfig.AccessHelp).focus();
			} else if (currkey == NumTwoKey) {
				//alt+2: 定位到网站导航容器，
				createNodeDiv(BarrierFreeConfig.MainNavigation, BarrierFreeConfig.MainNavigationTitle);
			} else if (currkey == NumThreeKey) {
				//alt+3: 定位到网站服务引导区，
				createNodeDiv(BarrierFreeConfig.HeaderGuide, BarrierFreeConfig.HeaderGuideTitle);
			} else if (currkey == NumFourKey) {
				//alt+4: 定位到主要内容区，
				createNodeDiv(BarrierFreeConfig.MainContent, BarrierFreeConfig.MainContentTitle);
			} else if (currkey == NumFiveKey) {
				//alt+5: 定位到网站地图连接，
				createNodeDiv(BarrierFreeConfig.SiteMap, BarrierFreeConfig.SiteMapTitle);
				//document.getElementById(SiteMap).focus();
			} else if (currkey == NumSixKey) {
				//alt+6: 定位到页面主要搜索框，
				createNodeDiv(BarrierFreeConfig.SearchForm, BarrierFreeConfig.SearchFormTitle);
			}
		}
	}
	/*--------------------------------------------------------热点跳转结束-------------------------------------------------------*/
	/*------------------------------------------------------分组栏目跳转开始-----------------------------------------------------*/
	if (currkey == GroupTagKey) {
		if ((!e.altKey && !e.shiftKey && e.ctrlKey) || (e.altKey && !e.shiftKey && !e.ctrlKey)) {
			groupSkip(0);
			//分组栏目跳转快捷键：ctrl+Z
		} else if ((!e.altKey && e.shiftKey && e.ctrlKey) || (e.altKey && e.shiftKey && !e.ctrlKey)) {
			groupSkip(1);
			//分组栏目逆向跳转快捷键：ctrl+shift+z
		}
	}
	/*--------------------------------------------------------分组栏目跳转结束----------------------------------------------------*/
	/*----------------------------------------------------------区域跳转开始------------------------------------------------------*/
	if (e.altKey && e.shiftKey && !e.ctrlKey) {
		if (currkey == NumOneKey) {
			//alt+shift+1：跳转到头部，
			createNodeDiv(BarrierFreeConfig.HeadContent, BarrierFreeConfig.HeadContentTitle);
		} else if (currkey == NumTwoKey) {
			//alt+shift+4: 跳转到左栏，
			createNodeDiv(BarrierFreeConfig.LeftContent, BarrierFreeConfig.LeftContentTitle);
		} else if (currkey == NumThreeKey) {
			//alt+shift+3: 跳转到中间区域，
			createNodeDiv(BarrierFreeConfig.MiddleContent, BarrierFreeConfig.MiddleContentTitle);
		} else if (currkey == NumFourKey) {
			//alt+shift+5: 跳转到右栏，
			createNodeDiv(BarrierFreeConfig.RightContent, BarrierFreeConfig.RightContentTitle);
		} else if (currkey == NumFiveKey) {
			//alt+shift+2: 跳转到底部，
			createNodeDiv(BarrierFreeConfig.BottomContent, BarrierFreeConfig.BottomContentTitle);
		}
	}
	/*----------------------------------------------------------区域跳转结束------------------------------------------------------*/
}

//栏目分组跳转

function groupSkip(skipFlag, GroupTagName) {
	var allSkipNode = new Array();
	var j = 0;
	var allNode = document.getElementsByTagName("*");
	for (i = 0; i < allNode.length; i++) {
		var newNodeName = allNode[i].nodeName;
		if (newNodeName == BarrierFreeConfig.GroupTagNameH2 || newNodeName == BarrierFreeConfig.GroupTagNameH3 || newNodeName == BarrierFreeConfig.GroupTagNameH4) {
			allSkipNode[j] = i;
			j++;
		}
	}
	//获取栏目分组跳转标签的个数
	var NumGroupTagID = allSkipNode.length
	if (NumGroupTagID == 0) {
		return;
	}
	//没有栏目分组标签返回
	if (skipFlag == 0) {
		//分组栏目正向跳转
		ForwardFlag = true;
		if (BackwardFlag) {
			BackwardFlag = false;
		}
		this.GroupCount++;
		if (this.GroupCount > NumGroupTagID - 1) {
			this.GroupCount = 0;
		}
	} else if (skipFlag == 1) {
		//分组栏目逆向跳转
		BackwardFlag = true;
		if (ForwardFlag) {
			ForwardFlag = false;
		}
		this.GroupCount--;
		if (this.GroupCount < 0) {
			this.GroupCount = NumGroupTagID - 1;
		}
	}
	var mainDiv = allNode[allSkipNode[GroupCount]];
	var titleText = mainDiv.innerText || mainDiv.textContent;
	var title = titleText + "";
	if (mainDiv.nodeName == BarrierFreeConfig.GroupTagNameH2) {
		title = titleText + "";
	}
	createNode(mainDiv, title);
}

//创建层节点：----------------------------------

function createNodeDiv(divID, title) {
	var mainDiv = document.getElementById(divID);
	//若主目录下无跳转ID，查看Iframe中是否有
	if (!mainDiv) {
		mainDiv = iframeSearch(divID);
		if (!mainDiv) {
			return;
		}
	}
	createNode(mainDiv, title);
}
//在跳转区域第一个子节点前创建----------------

function createNode(mainDiv, title) {
	var newNode = document.createElement("div");
	newNode.style.cssText = "width:0px;height:0px;overflow:hidden;";
	newNode.innerHTML = "<a href=\"javascript:\" title=\"" + title + "\" onblur=\"deleteNodeDiv(this)\">" + title + "</a>";
	mainDiv.parentNode.insertBefore(newNode, mainDiv);
	newNode.firstChild.focus();
}

//删除层节点----------------------------------

function deleteNodeDiv(node) {
	var browser = browserFlag();
	if (browser.ie) {
		node.parentNode.removeNode(true);
	} else {
		node.parentNode.parentNode.removeChild(node.parentNode);
	}
}
//查找Iframe中快捷键ID

function iframeSearch(divID) {
	var iframeNode = document.body.getElementsByTagName("iframe");
	if (!iframeNode) {
		return;
	}
	for (var i = 0; i < iframeNode.length; i++) {
		try {
			var newDivID = iframeNode[i].contentWindow.document.getElementById("divID");
		} catch (e) {}
	}
	return newDivID;
}

//在iframe中增加监听调用父页面监听函数
function addKeyListenerToIframe(iframeObject)
{
	var iframeNode = document.body.getElementsByTagName("iframe");
	if(!iframeNode){return;}	
	for(var i=0;i<iframeNode.length;i++){
		var iframeObject = iframeNode[i].contentWindow;
		bindKeyDownEvent(iframeObject);
	}
}

function bindKeyDownEvent(iframeObject)
{
	try {
		iframeObject.document.onkeydown = KeyDownEvent;
		var iFrameAllNode = iframeObject.document.getElementsByTagName("body")[0].getElementsByTagName("*");
		for (var j = 0; j < iFrameAllNode.length;j++ ) {
			if(iFrameAllNode[j].tagName == 'iframe' || iFrameAllNode[j].tagName=='IFRAME') {
				var innerIframeObject = iFrameAllNode[j].contentWindow;
				bindKeyDownEvent(innerIframeObject);
			}
		}
	} catch (e) {}
}
function KeyDownEvent(e) {
	//快捷键获取
	var currkey = 0,
	e = e || event || window.event;
	currkey = e.keyCode || e.which || e.charCode;
	//快捷键键盘监听
	top.accessKeyboardListener(currkey, e);
	//工具条键盘监听
	top.toolBarKeyDownEvent(currkey, e);
}
